// SPDX-License-Identifier: MIT
pragma solidity ^0.8.13;

import "./utils/Counters.sol";
import "./token/ERC721/ERC721.sol";
import "./security/ReentrancyGuard.sol";


import "./token/ERC20/extensions/IERC20Metadata.sol";
import "./token/ERC20/IERC20.sol";


contract Marketplace is ReentrancyGuard {
  using Counters for Counters.Counter;
  Counters.Counter private _nftsSold;
  Counters.Counter private _nftCount;

  uint256 public constant VERSION = 20221025002;
  uint256 public LISTING_FEE = 0.0001 ether;

  address payable private _marketOwner;

  mapping(uint256 => NFT) private _idToNFT;
  struct NFT {
    uint256 nftIndex;
    address nftContract;
    uint256 tokenId;
    address payable seller;
    address payable owner;
    uint256 price;
    address token;
    bool listed;
  }

  event NFTListed(
    address nftContract,
    uint256 tokenId,
    address seller,
    address owner,
    uint256 price,
    address token
  );
  event NFTDelisted(
    address nftContract,
    uint256 tokenId,
    address seller,
    address owner,
    uint256 price,
    address token
  );
  event NFTSold(
    address nftContract,
    uint256 tokenId,
    address seller,
    address owner,
    uint256 price,
    address token
  );

  constructor() {
    _marketOwner = payable(msg.sender);
  }

  // List the NFT on the marketplace
  function listNft(address _nftContract, uint256 _tokenId, uint256 _price, address _token) public payable nonReentrant {
    require(_price > 0, "Price must be at least 1 wei");
    require(msg.value == LISTING_FEE, "Not enough ether for listing fee");

    IERC721(_nftContract).transferFrom(msg.sender, address(this), _tokenId);

    _nftCount.increment();

    uint nftIndex = _nftCount.current();

    _idToNFT[nftIndex] = NFT(
      nftIndex,
      _nftContract,
      _tokenId, 
      payable(msg.sender),
      payable(address(this)),
      _price,
      _token,
      true
    );

    emit NFTListed(_nftContract, _tokenId, msg.sender, address(this), _price, _token);
  }

   // de-list an NFT
  function delistNft(uint256 _nftIndex) public payable nonReentrant {
    NFT storage nft = _idToNFT[_nftIndex];

    IERC721(nft.nftContract).transferFrom(address(this), msg.sender, nft.tokenId);

    nft.listed = false;

    _nftsSold.increment();
    emit NFTDelisted(nft.nftContract, nft.tokenId, address(this), msg.sender, nft.price, nft.token);
  }

  // Buy an NFT
  function buyNft(uint256 _nftIndex) public payable nonReentrant {
    NFT storage nft = _idToNFT[_nftIndex];
   // require(msg.value >= nft.price, "Not enough ether to cover asking price");

    address payable buyer = payable(msg.sender);

    //payable(nft.seller).transfer(msg.value);
    //IERC721(_nftContract).transferFrom(address(this), buyer, nft.tokenId);

    IERC20 _ccytok = IERC20(nft.token);
    _ccytok.transferFrom(buyer, nft.seller, nft.price);

    IERC721(nft.nftContract).transferFrom(address(this), buyer, nft.tokenId);

    _marketOwner.transfer(LISTING_FEE);
    nft.owner = buyer;
    nft.listed = false;

    _nftsSold.increment();
    emit NFTSold(nft.nftContract, nft.tokenId, nft.seller, buyer, nft.price, nft.token);
  }

  // Resell an NFT purchased from the marketplace
  function resellNft(uint256 _nftIndex, uint256 _price) public payable nonReentrant {
    require(_price > 0, "Price must be at least 1 wei");
    require(msg.value == LISTING_FEE, "Not enough ether for listing fee");

    NFT storage nft = _idToNFT[_nftIndex];

    IERC721(nft.nftContract).transferFrom(msg.sender, address(this), nft.tokenId);

    nft.seller = payable(msg.sender);
    nft.owner = payable(address(this));
    nft.listed = true;
    nft.price = _price;

    _nftsSold.decrement();
    emit NFTListed(nft.nftContract, nft.tokenId, msg.sender, address(this), _price, nft.token);
  }

  function getListingFee() public view returns (uint256) {
    return LISTING_FEE;
  }

  function getVersion() public pure returns (uint256) {
    return VERSION;
  }

  function getNft(address _nftContract, uint256 _tokenId) public view returns (NFT memory) {
    uint256 nftCount = _nftCount.current();
    for (uint256 i = 0; i < nftCount; i++) {
      NFT memory nft = _idToNFT[i];

      if ((nft.nftContract == _nftContract) && (nft.tokenId == _tokenId))
        return nft;
    }

    revert('Not found');
  }

  function getListedNfts() public view returns (NFT[] memory) {
    uint256 nftCount = _nftCount.current();
    uint256 unsoldNftsCount = nftCount - _nftsSold.current();

    NFT[] memory nfts = new NFT[](unsoldNftsCount);
    uint nftsIndex = 0;
    for (uint i = 0; i < nftCount; i++) {
      if (_idToNFT[i + 1].listed) {
        nfts[nftsIndex] = _idToNFT[i + 1];
        nftsIndex++;
      }
    }
    return nfts;
  }

  function getMyNfts() public view returns (NFT[] memory) {
    uint nftCount = _nftCount.current();
    uint myNftCount = 0;
    for (uint i = 0; i < nftCount; i++) {
      if (_idToNFT[i + 1].owner == msg.sender) {
        myNftCount++;
      }
    }

    NFT[] memory nfts = new NFT[](myNftCount);
    uint nftsIndex = 0;
    for (uint i = 0; i < nftCount; i++) {
      if (_idToNFT[i + 1].owner == msg.sender) {
        nfts[nftsIndex] = _idToNFT[i + 1];
        nftsIndex++;
      }
    }
    return nfts;
  }

  function getMyListedNfts() public view returns (NFT[] memory) {
    uint nftCount = _nftCount.current();
    uint myListedNftCount = 0;
    for (uint i = 0; i < nftCount; i++) {
      if (_idToNFT[i + 1].seller == msg.sender && _idToNFT[i + 1].listed) {
        myListedNftCount++;
      }
    }

    NFT[] memory nfts = new NFT[](myListedNftCount);
    uint nftsIndex = 0;
    for (uint i = 0; i < nftCount; i++) {
      if (_idToNFT[i + 1].seller == msg.sender && _idToNFT[i + 1].listed) {
        nfts[nftsIndex] = _idToNFT[i + 1];
        nftsIndex++;
      }
    }
    return nfts;
  }
}
